const Persons = (props) => {
    const liStyle = {
        color: 'grey',
        listStyleType: ""
      }
    const ulStyle = {
        textDecoration: ""
    }

    const personContainer = {
       color: 'green'
    }
    return(

    <ul style={ulStyle}>
    {props.persons.map((person) => 
        <li className={liStyle} key={person.id}>
            <div className={personContainer}>   
                <div>{person.name}</div>
                <div>{person.number}</div>
                <button onClick={() => props.onDelete(person.id)} >Delete</button>
            </div>      
        </li>)}
    </ul>
    )}

export default Persons
